    '2'
    >>> solution("6\n1 3\n0 2 4\n1 5\n0 4\n1 3 5\n2 4\n")
    '2'
    >>> solution("4\n1 2\n0 2 3\n0 1\n1\n")
    '3'
    """
    n = int(stdin.split()[0])
    edges = [tuple(map(int, line.split())) for line in stdin.splitlines()[1:]]
    graph = {v: set() for v in range(n)}
    for v1, v2 in edges:
        graph[v1].add(v2)
        graph[v2].add(v1)
    colors = {}
    for v in range(n):
        if v not in colors:
            colors[v] = 0
        for neighbor in graph[v]:
            if neighbor not in colors:
                colors[neighbor] = colors[v] + 1
            else:
                colors[neighbor] = min(colors[neighbor], colors[v] + 1)
    return str(max(colors.values()))

