    Args:
        stdin (str): Input string

    Returns:
        str: String containing all good nodes
    """
    n = int(stdin.split("\n")[0])
    edges = [tuple(map(int, line.split())) for line in stdin.split("\n")[1:]]
    good_nodes = set()
    for edge in edges:
        if edge[0] not in good_nodes:
            good_nodes.add(edge[0])
        if edge[1] not in good_nodes:
            good_nodes.add(edge[1])
    return "\n".join(map(str, sorted(good_nodes)))

