            for j in range(l):
                if board[-1][i] == '#':
                    break
                board[-1][i] = '#'
                i += 1
        elif d == 'left':
            for j in range(l):
                if board[i][0] == '#':
                    break
                board[i][0] = '#'
                i += 1
