def solution(stdin: str) -> str:
    """Finds the smallest package size that contains at least B bolts.

    Args:
        stdin (str): Input string

    Returns:
        str: Output string
    """
    # Get input
    B = int(stdin.split("\n")[0])
    k = int(stdin.split("\n")[1])
    packages = []
    for i in range(k):
        packages.append(list(map(int, stdin.split("\n")[i + 2].split())))

    # Find the smallest package size that contains at least B bolts
    min_package_size = None
    for package in packages:
        if sum(package) >= B:
            if min_package_size is None:
                min_package_size = package
            else:
                min_package_size = min(min_package_size, package)

    # Return the smallest package size that contains at least B bolts
    if min_package_size is None:
        return "impossible"
    else:
        return str(min_package_size[0])

